import { Routes, Route } from "react-router-dom";

export const RoutesComputing = () => {
  return (
    <Routes>
      <Route
        path="/concepts/computing"
        element={<h1>Estas en el Estudio de C++</h1>}
      />
    </Routes>
  );
};

export const RoutesProgramming = () => {
  return (
    <Routes>
      <Route
        path="/concepts/programming"
        element={<h1>Estas en el Estudio de Programacion</h1>}
      />
    </Routes>
  );
};
